import { Component, OnInit, OnChanges, Input, SimpleChanges } from '@angular/core';

@Component({
  selector: 'app-lazy-load-image',
  templateUrl: './lazy-load-image.component.html',
  styleUrls: ['./lazy-load-image.component.scss']
})
export class LazyLoadImageComponent implements OnInit, OnChanges {
// tslint:disable-next-line:max-line-length
loaderErr: string = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAV4AAAFeAQMAAAD35eVZAAAAA1BMVEXm5uZLWILvAAAAJklEQVRo3u3BMQEAAADCIPun9l0IYAAAAAAAAAAAAAAAAAAAAMQBPYYAAbUA8+EAAAAASUVORK5CYII=';

// tslint:disable-next-line:max-line-length
loaderSrc: string = 'data:image/gif;base64,';

@Input()
src: string;

@Input()
errorSrc: string;

state: 'loading' | 'loaded' | 'error' = 'loading';

constructor() { }

ngOnInit(): void { }

ngOnChanges(changes: SimpleChanges): void {
  if (changes.firstChange) {
    return;
  }

  const image = new Image();
  image.onload = () => {
    setTimeout(() => {
      this.state = 'loaded';
    }, 50);
  };
  image.onerror = () => {
    setTimeout(() => {
      this.state = 'error';
    }, 50);
  };
  image.src = changes.src.currentValue;
}

}
